import React from 'react';
import {Toolbar,Typography,CssBaseline, Container, Box} from '@material-ui/core';
import imgLogo from './images/logo.png'
import './App.css';

function App() {
  return (
    <div className="App">
    <CssBaseline />
    <header>
    <img src={imgLogo} title="spectrum global" />

    </header>
    <Toolbar />
    <Container>
      <Box my={2}>{                    
            <h2>Spectrum global events</h2>                 
        }
      </Box>
    </Container>    
  </div>
  );
}

export default App;
